let menu = document.querySelector(".menu");
let burgers = document.querySelectorAll(".burger");
let body = document.querySelector('body');


menu.addEventListener('click', (e) => {
    e.stopPropagation();
});

// Burger
if (burgers) {
    for (let i = 0; i < burgers.length; i++) {
        const burger = burgers[i];
        burger.addEventListener('click', function (e) {
            menu.classList.toggle('menu_toggle');
            this.classList.toggle('burger_toggle');
            e.stopPropagation();
            // body.classList.toggle('body-toggle');
        });
    }
}
// Burger


// Close menu on press Esc button
document.addEventListener('keydown', function (e) {
    if (e.keyCode === 27) {
        menu.classList.remove('menu_toggle');
        for (let i = 0; i < burgers.length; i++) {
            const burger = burgers[i];
            burger.classList.remove('burger_toggle');
        }

        body.classList.remove('body-toggle');
    }
});
// Close menu on press Esc button

// Close menu on click outside
document.addEventListener('click', function () {

    menu.classList.remove('menu_toggle');
    for (let i = 0; i < burgers.length; i++) {
        const burger = burgers[i];
        burger.classList.remove('burger_toggle');
    }
    body.classList.remove('body-toggle');

});
// Close menu on click outside

//  Change menu on scroll

let scrollSwitcher = true;


function headerScroll() {
    let scrollTop = window.scrollY;
    let haeder = document.querySelector('.header');
    let navbar = document.querySelector('.navbar');
    let top = document.querySelector('.top');
    let navbarList = document.querySelector('.navbar__list');
    let search = document.querySelector('.search');
    let topOffset = 0;

    if (haeder) {
        let haederHeight = haeder.offsetHeight;
        topOffset +=  haederHeight;
    }
    if (navbar) {
        let navbarHeight = navbar.offsetHeight;
        topOffset += navbarHeight;
    }
    if (top) {
        let topHeight = top.offsetHeight;
        topOffset += topHeight;
    }

    // let topOffset = topHeight + navbarHeight + haederHeight;
    let topSearch = document.querySelector('.top__search');

    if (scrollTop > topOffset) {
        if (scrollSwitcher) {
            navbar.classList.add('navbar_scroll');
            navbarList.style.display = 'none';
            if (topSearch) {
                navbar.querySelector('.navbar__inner').appendChild(search);
            }
            scrollSwitcher = false;
        }
    } else {
        navbar.classList.remove('navbar_scroll');
        if (topSearch) {
            topSearch.appendChild(search);
        }
        navbarList.style.display = 'flex';
        scrollSwitcher = true;
    }
}
['scroll', 'load'].forEach(evt =>
    window.addEventListener(evt, () => {
        headerScroll();
    }, false)
);

