let categories = document.querySelectorAll('.category-block__list .category-item');
let sublists = document.querySelectorAll('.category-block__sublist');

for (let i = 0; i < categories.length; i++) {
    const category = categories[i];

    if (category) {
        category.addEventListener('click', () => {
            for (let j = 0; j < categories.length; j++) {

                if (categories[j] != category) {
                    categories[j].closest('.category-block__item').classList.add('category-item_hidden');
                } else {
                    category.classList.add('category-item_active');
                }
            }
        });

        category.querySelector('.category-item__back').addEventListener('click', (e) => {
            for (let k = 0; k < categories.length; k++) {
                categories[k].closest('.category-block__item').classList.remove('category-item_hidden');
                e.stopPropagation();
            }
            category.classList.remove('category-item_active');
            for (const sublist of sublists) {
                if (sublist) { sublist.classList.remove('_active'); }
            }
        });
    }
}
